import React from 'react';
import { Form } from 'react-bootstrap';

import '../App.css';


{/* Contact page */}

function Contact() {
    return (
        <div className="App-header">
            <form>
                <label>
                    Name:
                    <input type="text" name="name" />
                </label>
                <input type="submit" value="Submit" />
            </form>
        </div>
    );
}

export default Contact;
